import React from 'react';
import '../assets/scss/style.scss';

const Scss = () => {
  return (
    <div>
      <h2>Scss</h2>
      <div className="myScss">
        <div className="myScssBos red" />
        <div className="myScssBos green" />
        <div className="myScssBos blue" />
        <div className="myScssBos " />
        <div className="myScssBos " />
        <div className="myScssBos " />
      </div>
    </div>
  );
};

export default Scss;
